<!DOCTYPE html>

<head>
  <style type="text/css">
    @import url(https://fonts.googleapis.com/css?family=Open+Sans&display=swap);
    @import url(https://fonts.googleapis.com/css?family=Ubuntu&display=swap);
    @import url(https://fonts.googleapis.com/css?family=Pacifico&display=swap);

    /* Floating animation for planets */
    .float {
      -webkit-animation-name: Floating1;
      -webkit-animation-duration: 6s;
      -webkit-animation-iteration-count: infinite;
      -webkit-animation-timing-function: ease-in-out;

      -moz-animation-name: Floating1;
      -moz-animation-duration: 6s;
      -moz-animation-iteration-count: infinite;
      -moz-animation-timing-function: ease-in-out;

      animation-name: Floating1;
      animation-duration: 6s;
      animation-iteration-count: infinite;
      animation-timing-function: ease-in-out;
    }

    @-webkit-keyframes Floating1 {
      from {
        -webkit-transform: translate(0, 0px);
        -moz-transform: translate(0, 0px);
        transform: translate(0, 0px);
      }

      65% {
        -webkit-transform: translate(0, 30px);
        -moz-transform: translate(0, 30px);
        transform: translate(0, 30px);
      }

      to {
        -webkit-transform: translate(0, -0px);
        -moz-transform: translate(0, -0px);
        transform: translate(0, -0px);
      }
    }

    @-moz-keyframes Floating1 {
      from {
        -webkit-transform: translate(0, 0px);
        -moz-transform: translate(0, 0px);
        transform: translate(0, 0px);
      }

      65% {
        -webkit-transform: translate(0, 30px);
        -moz-transform: translate(0, 30px);
        transform: translate(0, 30px);
      }

      to {
        -webkit-transform: translate(0, -0px);
        -moz-transform: translate(0, -0px);
        transform: translate(0, -0px);
      }
    }

    @keyframes Floating1 {
      from {
        -webkit-transform: translate(0, 0px);
        -moz-transform: translate(0, 0px);
        transform: translate(0, 0px);
      }

      65% {
        -webkit-transform: translate(0, 30px);
        -moz-transform: translate(0, 30px);
        transform: translate(0, 30px);
      }

      to {
        -webkit-transform: translate(0, -0px);
        -moz-transform: translate(0, -0px);
        transform: translate(0, -0px);
      }
    }

    /*  Floating animation for stars */
    #Stars {
      -webkit-animation-name: Floating2;
      -webkit-animation-duration: 15s;
      -webkit-animation-iteration-count: infinite;
      -webkit-animation-timing-function: ease-in-out;

      -moz-animation-name: Floating2;
      -moz-animation-duration: 15s;
      -moz-animation-iteration-count: infinite;
      -moz-animation-timing-function: ease-in-out;

      animation-name: Floating2;
      animation-duration: 15s;
      animation-iteration-count: infinite;
      animation-timing-function: ease-in-out;
    }

    @-webkit-keyframes Floating2 {
      from {
        -webkit-transform: translate(0, 0px);
        -moz-transform: translate(0, 0px);
        transform: translate(0, 0px);
      }

      70% {
        -webkit-transform: translate(0, 30px);
        -moz-transform: translate(0, 30px);
        transform: translate(0, 30px);
      }

      to {
        -webkit-transform: translate(0, -0px);
        -moz-transform: translate(0, -0px);
        transform: translate(0, -0px);
      }
    }

    @-moz-keyframes Floating2 {
      from {
        -webkit-transform: translate(0, 0px);
        -moz-transform: translate(0, 0px);
        transform: translate(0, 0px);
      }

      70% {
        -webkit-transform: translate(0, 30px);
        -moz-transform: translate(0, 30px);
        transform: translate(0, 30px);
      }

      to {
        -webkit-transform: translate(0, -0px);
        -moz-transform: translate(0, -0px);
        transform: translate(0, -0px);
      }
    }

    @keyframes Floating2 {
      from {
        -webkit-transform: translate(0, 0px);
        -moz-transform: translate(0, 0px);
        transform: translate(0, 0px);
      }

      70% {
        -webkit-transform: translate(0, 30px);
        -moz-transform: translate(0, 30px);
        transform: translate(0, 30px);
      }

      to {
        -webkit-transform: translate(0, -0px);
        -moz-transform: translate(0, -0px);
        transform: translate(0, -0px);
      }
    }

    /* Glowing animation for Nullidea text */
    .glow {
      -webkit-animation: glow 1.5s ease-in-out infinite alternate;
      -moz-animation: glow 1.5s ease-in-out infinite alternate;
      animation: glow 1.5s ease-in-out infinite alternate;
    }

    @keyframes glow {
      from {
        text-shadow: 0 0 10px #ff2;
      }
    }

    @-webkit-keyframes glow {
      from {
        text-shadow: 0 0 10px #ff2;
      }
    }

    body {
      background-color: black;
      margin: 1% 2%;
    }

    svg {
      stroke: transparent;
      stroke-width: 0px;
    }

    html {
      scroll-behavior: smooth;
    }

      <g id="About-3" data-name="About" transform="translate(-77 -134)">
        <text
          id="Every_day_developers_tend_to_spend_a_huge_amount_of_time_to_think_about_something_new_unique_or_phenomenal_that_could_be_benevolent_for_humankind_but_not_always_one_can_succeed._Instead_of_spending_precious_time_on_speculation_one_can_lookup_idea_som"
          data-name="Every day, developers tend to spend a huge amount of time to think about something new, unique or phenomenal that could be benevolent for humankind, but not always one can succeed. 
  
  Instead of spending precious time on speculation, one can lookup idea som" transform="translate(257 1357)"
          fill="#c4baba" font-size="30" font-family="Ubuntu-Medium, Ubuntu" font-weight="500">
          <tspan x="3.965" y="28">Every day, developers tend to spend a </tspan>
          <tspan x="18.86" y="63">huge amount of time to think about </tspan>
          <tspan x="87.38" y="98">something new, unique or </tspan>
          <tspan x="2.36" y="133">phenomenal that could be benevolent </tspan>
          <tspan x="26.885" y="168">for humankind, but not always one </tspan>
          <tspan x="180.32" y="203">can succeed. </tspan>
          <tspan x="267.5" y="238"></tspan>
          <tspan x="10.58" y="273">Instead of spending precious time on </tspan>
          <tspan x="40.52" y="308">speculation, one can lookup idea </tspan>
          <tspan x="79.775" y="343">somewhere and embark on </tspan>
          <tspan x="119.18" y="378">implementation of it.</tspan>
          <tspan x="267.5" y="413"></tspan>
          <tspan x="52.685" y="448">Subsequently, if there will be a </tspan>
          <tspan x="5.03" y="483">platform that would allow developers </tspan>
          <tspan x="10.4" y="518">to communicate and share ideas with </tspan>
          <tspan x="44.705" y="553">each other, then, the realization </tspan>
          <tspan x="81.41" y="588">process of idea, facilitates.</tspan>
        </text>
        <text
          id="After_surveying_bunch_of_developers_and_evaluating_their_results_such_system_seems_to_be_very_useful._As_outcome_one_can_imagine_an_ecosystem_with_following_functions:_1._Sharing_of_ideas_2._Searching_for_like-minded_developers_3._Acquiring_insp"
          data-name="After surveying bunch of developers 
  and evaluating their results, such 
  system seems to be very useful.
  
  As outcome, one can imagine an 
  ecosystem with following functions: 
  
  1. Sharing of ideas
  
  2. Searching for like-minded 
  developers
  
  3. Acquiring insp" transform="translate(1221 1913)" fill="#c4baba" font-size="30" font-family="Ubuntu-Medium, Ubuntu"
          font-weight="500">
          <tspan x="5.985" y="28">After surveying bunch of developers </tspan>
          <tspan x="29.175" y="63">and evaluating their results, such </tspan>
          <tspan x="38.745" y="98">system seems to be very useful.</tspan>
          <tspan x="259.5" y="133"></tspan>
          <tspan x="37.125" y="168">As outcome, one can imagine an </tspan>
          <tspan x="9.015" y="203">ecosystem with following functions: </tspan>
          <tspan x="259.5" y="238"></tspan>
          <tspan x="132.435" y="273">1. Sharing of ideas</tspan>
          <tspan x="259.5" y="308"></tspan>
          <tspan x="65.265" y="343">2. Searching for like-minded </tspan>
          <tspan x="181.89" y="378">developers</tspan>
          <tspan x="259.5" y="413"></tspan>
          <tspan x="98.235" y="448">3. Acquiring inspiration</tspan>
          <tspan x="259.5" y="483"></tspan>
          <tspan x="70.47" y="518">4. Finding financial support</tspan>
          <tspan x="259.5" y="553"></tspan>
          <tspan x="0.075" y="588">5. Financially supporting projects and </tspan>
          <tspan x="96.72" y="623">conclude an agreement</tspan>
        </text>
